t_020_ecs.llm_output:
use spacetimedb::{reducer, table, ReducerContext, Table, UniqueColumn};

#[table(name = entities)]
pub struct Entity {
    #[primary_key]
    id: i32,
}

#[table(name = positions)]
pub struct Position {
    #[primary_key]
    entity_id: i32,
    x: i32,
    y: i32,
}

#[table(name = velocities)]
pub struct Velocity {
    #[primary_key]
    entity_id: i32,
    vx: i32,
    vy: i32,
}

#[table(name = next_positions)]
pub struct NextPosition {
    #[primary_key]
    entity_id: i32,
    x: i32,
    y: i32,
}

#[reducer]
pub fn seed(ctx: &ReducerContext) {
    let _ = ctx.db.entities().try_insert(Entity { id: 1 });
    let _ = ctx.db.entities().try_insert(Entity { id: 2 });

    let p1 = Position {
        entity_id: 1,
        x: 0,
        y: 0,
    };
    if ctx.db.positions().entity_id().find(1).is_some() {
        let _ = ctx.db.positions().entity_id().update(p1);
    } else {
        let _ = ctx.db.positions().insert(p1);
    }

    let v1 = Velocity {
        entity_id: 1,
        vx: 1,
        vy: 0,
    };
    if ctx.db.velocities().entity_id().find(1).is_some() {
        let _ = ctx.db.velocities().entity_id().update(v1);
    } else {
        let _ = ctx.db.velocities().insert(v1);
    }

    let p2 = Position {
        entity_id: 2,
        x: 10,
        y: 0,
    };
    if ctx.db.positions().entity_id().find(2).is_some() {
        let _ = ctx.db.positions().entity_id().update(p2);
    } else {
        let _ = ctx.db.positions().insert(p2);
    }

    let v2 = Velocity {
        entity_id: 2,
        vx: -2,
        vy: 3,
    };
    if ctx.db.velocities().entity_id().find(2).is_some() {
        let _ = ctx.db.velocities().entity_id().update(v2);
    } else {
        let _ = ctx.db.velocities().insert(v2);
    }
}

#[reducer]
pub fn step(ctx: &ReducerContext) {
    for p in ctx.db.positions().iter() {
        if let Some(v) = ctx.db.velocities().entity_id().find(p.entity_id) {
            let np = NextPosition {
                entity_id: p.entity_id,
                x: p.x + v.vx,
                y: p.y + v.vy,
            };
            if ctx
                .db
                .next_positions()
                .entity_id()
                .find(p.entity_id)
                .is_some()
            {
                let _ = ctx.db.next_positions().entity_id().update(np);
            } else {
                let _ = ctx.db.next_positions().insert(np);
            }
        }
    }
}

