using SpacetimeDB;

public static partial class Module
{
    [SpacetimeDB.Table(Name = "entities")]
    public partial struct Entity
    {
        [SpacetimeDB.PrimaryKey]
        public int Id;
    }

    [SpacetimeDB.Table(Name = "positions")]
    public partial struct Position
    {
        [SpacetimeDB.PrimaryKey]
        public int EntityId;
        public int X;
        public int Y;
    }

    [SpacetimeDB.Table(Name = "velocities")]
    public partial struct Velocity
    {
        [SpacetimeDB.PrimaryKey]
        public int EntityId;
        public int VX;
        public int VY;
    }

    [SpacetimeDB.Table(Name = "next_positions")]
    public partial struct NextPosition
    {
        [SpacetimeDB.PrimaryKey]
        public int EntityId;
        public int X;
        public int Y;
    }

    [SpacetimeDB.Reducer]
    public static void Seed(ReducerContext ctx)
    {
        UpsertEntity(ctx, 1);
        UpsertPosition(ctx, 1, 0, 0);
        UpsertVelocity(ctx, 1, 1, 0);

        UpsertEntity(ctx, 2);
        UpsertPosition(ctx, 2, 10, 0);
        UpsertVelocity(ctx, 2, -2, 3);
    }

    [SpacetimeDB.Reducer]
    public static void Step(ReducerContext ctx)
    {
        foreach (var pos in ctx.Db.positions.Iter())
        {
            var vel = ctx.Db.velocities.EntityId.Find(pos.EntityId);
            if (!vel.HasValue)
            {
                continue;
            }

            var nx = pos.X + vel.Value.VX;
            var ny = pos.Y + vel.Value.VY;

            var existing = ctx.Db.next_positions.EntityId.Find(pos.EntityId);
            if (existing.HasValue)
            {
                var np = existing.Value;
                np.X = nx;
                np.Y = ny;
                ctx.Db.next_positions.EntityId.Update(np);
            }
            else
            {
                ctx.Db.next_positions.Insert(new NextPosition
                {
                    EntityId = pos.EntityId,
                    X = nx,
                    Y = ny
                });
            }
        }
    }

    private static void UpsertEntity(ReducerContext ctx, int id)
    {
        var e = ctx.Db.entities.Id.Find(id);
        if (!e.HasValue)
        {
            ctx.Db.entities.Insert(new Entity { Id = id });
        }
    }

    private static void UpsertPosition(ReducerContext ctx, int entityId, int x, int y)
    {
        var p = ctx.Db.positions.EntityId.Find(entityId);
        if (p.HasValue)
        {
            var row = p.Value;
            row.X = x;
            row.Y = y;
            ctx.Db.positions.EntityId.Update(row);
        }
        else
        {
            ctx.Db.positions.Insert(new Position
            {
                EntityId = entityId,
                X = x,
                Y = y
            });
        }
    }

    private static void UpsertVelocity(ReducerContext ctx, int entityId, int vx, int vy)
    {
        var v = ctx.Db.velocities.EntityId.Find(entityId);
        if (v.HasValue)
        {
            var row = v.Value;
            row.VX = vx;
            row.VY = vy;
            ctx.Db.velocities.EntityId.Update(row);
        }
        else
        {
            ctx.Db.velocities.Insert(new Velocity
            {
                EntityId = entityId,
                VX = vx,
                VY = vy
            });
        }
    }
}

